import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

export const generateFichaPDF = async (type, data, documentos = [], formatDate) => {
  const pdf = new jsPDF('p', 'mm', 'a4');
  const margin = 10;
  let y = margin;

  const width = pdf.internal.pageSize.getWidth();
  const height = pdf.internal.pageSize.getHeight();

  // Agregar el logo de la empresa
  const logo = 'data:image/png;base64,';
  pdf.addImage(logo, 'PNG', margin, margin, 40, 40); 
  y += 50; // Espacio despus del logo

  // Ttulo principal
  pdf.setFontSize(16);
  pdf.setFont(undefined, 'bold');
  pdf.text('Ficha de Informacin', width / 2 - 40, y); // Centrado del ttulo
  y += 10;

  // Dibujar un rectngulo de borde
  pdf.setLineWidth(1);
  pdf.rect(margin, y, width - 2 * margin, 10);  // Rectngulo del ttulo
  y += 12;

  // Seccin segn el tipo 
  if (type === 'vehiculo') {
    pdf.setFontSize(14);
    pdf.text(`Ficha del Vehculo: ${data.marca} ${data.modelo}`, margin, y);
    y += 10;

    y = renderVehiculo(pdf, data, y, margin);
  }

  if (type === 'conductor') {
    pdf.setFontSize(14);
    pdf.text(`Ficha de Conductor: ${data.nombre} ${data.apellido}`, margin, y);
    y += 10;

    y = await renderConductor(pdf, data, y, margin, formatDate);
  }

  if (type === 'viaje') {
    pdf.setFontSize(14);
    pdf.text(`Detalles del Viaje: ${data.origen} - ${data.destino}`, margin, y);
    y += 10;

    y = renderViaje(pdf, data, y, margin, formatDate);
  }

  // Dibujar lnea divisoria entre secciones
  pdf.setLineWidth(0.5);
  pdf.line(margin, y, width - margin, y);
  y += 7;

  if (documentos.length > 0) {
    pdf.setFont(undefined, 'bold');
    pdf.text('Documentos', margin, y);
    y += 10;

    autoTable(pdf, {
      startY: y,
      head: [['Tipo de Documento', 'Fecha Emisin', 'Fecha Vencimiento']],
      body: documentos.map(doc => [
        doc.tipo_documento || 'No especificado',
        formatDate(doc.fecha_emision) || 'N/A',
        formatDate(doc.fecha_vencimiento) || 'N/A',
      ]),
      margin: { left: margin },
      styles: { fontSize: 10, halign: 'center' },
      headStyles: { fillColor: [0, 102, 204], textColor: [255, 255, 255] }, // Color de cabecera de tabla
      alternateRowStyles: { fillColor: [240, 240, 240] },
      tableLineWidth: 0.5,
      tableLineColor: [0, 0, 0],
    });
  }

  // Propiedades del PDF
  pdf.setProperties({
    title: `Ficha ${type}`,
    subject: 'Informacin',
    creator: 'Sistema de Gestin'
  });

  const filename = `Ficha_${type}_${(data.nombre || data.marca || data.origen || 'registro').replace(/\s/g, '_')}.pdf`;
  pdf.save(filename);
};

const renderVehiculo = (pdf, vehiculo, y, margin) => {
  pdf.setFontSize(12);
  pdf.setFont(undefined, 'bold');
  pdf.text('Informacin del Vehculo:', margin, y);
  y += 7;

  pdf.setFont(undefined, 'normal');
  const fields = [
    ['Patente', vehiculo.patente],
    ['Cdigo', vehiculo.codigo],
    ['Estado', vehiculo.estado],
    ['Ao', vehiculo.anio],
    ['Tipo', vehiculo.tipo],
    ['Tara', vehiculo.tara],
    ['Carga Mxima', vehiculo.carga_maxima],
    ['Kilometraje', vehiculo.kilometraje],
  ];

  // Usar autoTable para cada seccin
  autoTable(pdf, {
    startY: y,
    head: [['Campo', 'Valor']],
    body: fields.map(([label, value]) => [label, value || 'No especificado']),
    margin: { left: margin },
    styles: { fontSize: 10, halign: 'center' },
    headStyles: { fillColor: [0, 102, 204], textColor: [255, 255, 255] }, // Color de cabecera de tabla
    alternateRowStyles: { fillColor: [240, 240, 240] },
    tableLineWidth: 0.5,
    tableLineColor: [0, 0, 0],
  });

  return y + fields.length * 6 + 10; 
};

const renderConductor = async (pdf, conductor, y, margin, formatDate) => {
  if (conductor.foto) {
    try {
      const img = new Image();
      img.crossOrigin = 'Anonymous';
      await new Promise((resolve, reject) => {
        img.onload = resolve;
        img.onerror = reject;
        img.src = conductor.foto;
      });
      pdf.addImage(img, 'JPEG', margin, y, 30, 30);
      y += 35;
    } catch (e) {
      console.warn('Imagen conductor no cargada', e);
    }
  }

  pdf.setFontSize(12);
  pdf.setFont(undefined, 'bold');
  pdf.text('Informacin Personal', margin, y);
  y += 7;

  pdf.setFont(undefined, 'normal');
  const info = [
    ['DNI', conductor.dni || 'No especificado'],
    ['Cdigo', conductor.codigo || `C-${String(conductor.id).padStart(3, '0')}`],
    ['Estado', conductor.estado || 'N/A'],
    ['Telfono', conductor.numero_contacto || 'No especificado'],
    ['Email', conductor.email_contacto || 'No especificado'],
    ['Direccin', conductor.direccion || 'No especificada'],
    ['Fecha Vencimiento', formatDate(conductor.fecha_vencimiento) || 'No especificada'],
  ];

  autoTable(pdf, {
    startY: y,
    head: [['Campo', 'Valor']],
    body: info.map(([label, value]) => [label, value || 'No especificado']),
    margin: { left: margin },
    styles: { fontSize: 10, halign: 'center' },
    headStyles: { fillColor: [0, 102, 204], textColor: [255, 255, 255] }, // Color de cabecera de tabla
    alternateRowStyles: { fillColor: [240, 240, 240] },
    tableLineWidth: 0.5,
    tableLineColor: [0, 0, 0],
  });

  return y + info.length * 6 + 10; 
};

const renderViaje = (pdf, viaje, y, margin, formatDate) => {
  pdf.setFont(undefined, 'bold');
  pdf.text('Informacin del Viaje', margin, y);
  y += 7;

  pdf.setFont(undefined, 'normal');
  const data = [
    ['Cdigo', viaje.codigo || 'No especificado'],
    ['Estado', viaje.estado || 'N/A'],
    ['Origen', viaje.origen || 'N/A'],
    ['Destino', viaje.destino || 'N/A'],
    ['Fecha Salida', formatDate(viaje.fecha_salida) || 'N/A'],
    ['Fecha Llegada', formatDate(viaje.fecha_llegada) || 'N/A'],
  ];

  autoTable(pdf, {
    startY: y,
    head: [['Campo', 'Valor']],
    body: data.map(([label, value]) => [label, value || 'N/A']),
    margin: { left: margin },
    styles: { fontSize: 10, halign: 'center' },
    headStyles: { fillColor: [0, 102, 204], textColor: [255, 255, 255] }, // Color de cabecera de tabla
    alternateRowStyles: { fillColor: [240, 240, 240] },
    tableLineWidth: 0.5,
    tableLineColor: [0, 0, 0],
  });

  return y + data.length * 6 + 10; 
};
